set autocommit=0;
INSERT INTO `field_revision_body` VALUES ('node','article',0,14,14,'und',0,'<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"dnd-atom-wrapper\">\r\n<div class=\"dnd-drop-wrapper\">[scald=3:sdl_editor_representation]</div>\r\n\r\n<div class=\"dnd-legend-wrapper\">\r\n<div class=\"meta\"><!--copyright=3-->The Absolute Beginners Guide to Drupal, by ostrainingcom<!--END copyright=3--></div>\r\n</div>\r\n</div>\r\n\r\n<p>&lt;iframe width=\"560\" height=\"315\" src=\"http://www.youtube.com/embed/wZeeIYerCyA\" frameborder=\"0\" allowfullscreen&gt;&lt;/iframe&gt;</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"315\" src=\"http://www.youtube.com/embed/wZeeIYerCyA\" width=\"560\"></iframe></p>\r\n\r\n<p>&lt;iframe width=\"560\" height=\"315\" src=\"http://www.youtube.com/embed/wZeeIYerCyA\" frameborder=\"0\" allowfullscreen&gt;&lt;/iframe&gt;</p>\r\n','','full_html'),('node','supplier',0,15,15,'und',0,'<p>Lo trovi qui</p>\r\n','','filtered_html'),('node','supplier',0,16,16,'und',0,'<p>This is it</p>\r\n','','filtered_html'),('node','supplier',0,18,18,'und',0,'<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"dnd-atom-wrapper\">\r\n<div class=\"dnd-drop-wrapper\">[scald=3:sdl_editor_representation]</div>\r\n\r\n<div class=\"dnd-legend-wrapper\">\r\n<div class=\"meta\"><!--copyright=3-->The Absolute Beginners Guide to Drupal, by ostrainingcom<!--END copyright=3--></div>\r\n</div>\r\n</div>\r\n','','filtered_html'),('node','blog',0,19,19,'und',0,'<p>This is just a test</p>\r\n','','filtered_html'),('node','blog',0,20,20,'und',0,'<p>daft punk</p>\r\n','','filtered_html'),('node','supplier',0,24,24,'und',0,'<p>test etetst wes fd</p>\r\n','','filtered_html'),('node','page',0,25,25,'und',0,'<p>What is a fab lab?<br />\r\nFab labs are a global network of local labs, enabling invention by providing access to tools for digital fabrication</p>\r\n\r\n<p><span style=\"line-height:1.6em\">What\'s in a fab lab?</span><br />\r\n<span style=\"line-height:1.6em\">Fab labs share an evolving inventory of core capabilities to make (almost) anything, allowing people and projects to be shared</span></p>\r\n\r\n<p><span style=\"line-height:1.6em\">What does the fab lab network provide?</span><br />\r\n<span style=\"line-height:1.6em\">Operational, educational, technical, financial, and logistical assistance beyond what\'s available within one lab</span></p>\r\n\r\n<p><span style=\"line-height:1.6em\">Who can use a fab lab?</span><br />\r\n<span style=\"line-height:1.6em\">Fab labs are available as a community resource, offering open access for individuals as well as scheduled access for programs</span></p>\r\n\r\n<p><span style=\"line-height:1.6em\">What are your responsibilities?</span></p>\r\n\r\n<ul>\r\n	<li><em style=\"line-height:1.6em\">safety:</em><span style=\"line-height:1.6em\">&nbsp;not hurting people or machines</span></li>\r\n	<li><em>operations:</em>&nbsp;assisting with cleaning, maintaining, and improving the lab</li>\r\n	<li><em>knowledge:</em>&nbsp;contributing to documentation and instruction</li>\r\n</ul>\r\n\r\n<p><span style=\"line-height:1.6em\">Who owns fab lab inventions?</span><br />\r\n<span style=\"line-height:1.6em\">Designs and processes developed in fab labs can be protected and sold however an inventor chooses, but should remain available for individuals to use and learn from</span></p>\r\n\r\n<p><span style=\"line-height:1.6em\">How can businesses use a fab lab?</span><br />\r\n<span style=\"line-height:1.6em\">Commercial activities can be prototyped and incubated in a fab lab, but they must not conflict with other uses, they should grow beyond rather than within the lab, and they are expected to benefit the inventors, labs, and networks that contribute to their success</span></p>\r\n\r\n<p><em>draft:</em>&nbsp;October 20, 2012</p>\r\n\r\n<p>Source:&nbsp;<a href=\"http://fab.cba.mit.edu/about/charter/\">http://fab.cba.mit.edu/about/charter/</a></p>\r\n','','filtered_html'),('node','page',0,29,29,'und',0,'<div class=\"one_half\"><img class=\"alignleft scale-with-grid\" src=\"http://localhost/muse/sites/all/themes/skeletontheme/mockup/skeleton_devices.png\" /></div>\r\n\r\n<div class=\"one_half last\">&nbsp;\r\n<p>Skeleton is a powerful, clean, responsive theme ported to Drupal by <a href=\"http://www.morethanthemes.com/\" target=\"_blank\">More Than (just) Themes</a>. If you like this theme, we encourage you to try also of our other <a href=\"http://www.morethanthemes.com\" target=\"_blank\">Premium</a> and <a href=\"http://drupalizing.com\" target=\"_blank\">Free</a> Drupal themes.</p>\r\n\r\n<p>This theme is build over the <strong><a href=\"http://www.getskeleton.com/\" target=\"_blank\">Skeleton Boilerplate</a></strong> and was inspired by the excellent <strong><a href=\"http://demos.simplethemes.com/skeleton/\" target=\"_blank\">Skeleton Wordpress theme</a></strong> which has been designed by <a href=\"http://www.simplethemes.com/\" target=\"_blank\">Simple themes</a></p>\r\n\r\n<p>Today, people visit your website from a variety of devices ranging from desktop computers, tablets, and smart phones. The average user spends only a few seconds before making a decision to stay on your site or not. Skeleton is a Drupal 7 theme aimed at helping you build simple, uncluttered, useable, and mobile-friendly Drupal sites.</p>\r\n</div>\r\n','','full_html'),('node','page',0,30,30,'und',0,'<p>description here...</p>\r\n','','filtered_html'),('node','faq',0,31,31,'und',0,'<p>Answer...</p>\r\n','','filtered_html'),('node','event',0,37,37,'und',0,'<p>asfasfas</p>\r\n','','filtered_html');
/*!40000 ALTER TABLE `field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

